    retVal+=Run_Gravity();
    retVal+=Run_Solar();
    retVal+=Run_Battery();
    retVal+=Run_Reactor();
    retVal+=Run_GasFillLevel();
    retVal+=Run_MassCalc();

    Me.CustomData=retVal;
    display.WriteText(retVal);
